Because 10 frames was not enough from our gorgeous Dallas wedding… 

This was an air-conditioned tent attached to an old building, built in a couple of days on a big patch of grass. From the tent to the flooring to the speakers and mics wrapped in white fabric to the floral and cake design, the bars and linens and the food and busting of the tables and exceptional service and smooth transition of a band to a silent disco (noise ordinance, I did not expect that would be so fun) no detail was missed. I was blown away, @kirstinroseevents !! It would be my privilege to recognize the wedding creative team that made it all happen and made Annie and Will’s wedding clearly the best day ever!

